import { makeStyles } from "@material-ui/styles";

export default makeStyles((theme) => ({
  root: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
  },

  buttonWrapperLogin: {
    margin: "",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },

  titleLogin: {
    marginBottom: 25,
    textAlign: "center",
    color: "white",
  },

  paper: {
    padding: 10,
    height: "100%",
    display: "flex",

    justifyContent: "center",
  },
  image: {
    display: "flex",
    justifyContent: "center",
  },
  content: {
    maxWidth: "500px",
    minWidth: "500px",
    backgroundColor: "#33936E",
    padding: 36,
  },
}));
